import "./App.css";
import { Component } from "react";
class App extends Component {
  constructor() {
    super();
    this.state = {
      result: "",
    };
  }
  GetData = async () => {
    const { result } = this.state;
    let data = await fetch("https://pokeapi.co/api/v2/pokemon");
    result = await data.json();
    return result;
  };
  render() {
    return <>{this.GetData()}</>;
  }
}

export default App;
